function Table({data}) {
    const objectIntoTableData = (object) => {
        console.log("Object.values(object)",Object.values(object));
        // return Object.values(object).map((data, index) => {
        //     return  <td key={index}>{data}</td>;
        // });
    }

    const tableRows = (data) => {
        return data.map(value => {
            console.log(value.index);
            return <tr>{objectIntoTableData(value)}</tr>;
          });
    }

    return (
        <>
            <table>
                <thead>
                    <tr>
                        <th>First Name</th>
                        <th>Last Name</th>
                    </tr>
                </thead>
                <tbody>{tableRows(data)}</tbody>
            </table>
        </>
    )
}
export default Table;
